class Solution(object):
    def numSubarrayProductLessThanK(self, nums, k):
        if k <= 1:
            return 0
        prod = 1
        ans = p = 0
        for q in range(len(nums)):
            prod *= nums[q]
            while prod >= k:
                prod /= nums[p]
                p += 1
            ans += q - p + 1
        return ans

